    return (
        <div>
            <BrowserRouter>
        <main>
          <Routes>
            <Route path="/" element={<Test />}></Route>

          </Routes>
        </main>
      </BrowserRouter>
        <button className="btn btn-secondary mt-5 m-5">Welcome to Runk</button>
        </div>
    )
};
export default Test;
